import React from "react";
import RButton from "./RButton";
import styled from "styled-components";

const SRButton = styled.button`
  width: 200px;
  height: 25px;
  margin: 10px;

  outline: none;
  border: none;

  border-radius: 5px;

  transition: 0ms.5s;
`;

class App extends React.Component {
  render() {
    return (
      <div>
        <RButton />

        <SRButton>BUTTON</SRButton>
      </div>
    );
  }
}

export default App;
